import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  return (
    <div className="d-flex vh-100 justify-content-center align-items-center bg-dark text-light p-3">
      <div className="card p-4 p-md-5 text-center shadow" style={{ maxWidth: "600px", width: "100%" }}>
        <h1 className="mb-3 mb-md-4 display-6 display-md-4">
          Welcome Complaint Chain
        </h1>
        <p className="mb-4 fs-6 fs-md-5 text-secondary">
          Submit complaints, track their progress, and stay updated with public services efficiently.
          Start by creating an account or logging in.
        </p>
        <div className="d-flex flex-column flex-sm-column flex-md-row justify-content-center gap-3">
          <a href="/register" className="btn btn-primary btn-lg w-100 w-md-auto">
            Register
          </a>
          <a href="/login" className="btn btn-secondary btn-lg w-100 w-md-auto">
            Login
          </a>
        </div>
      </div>
    </div>
  );
};

export default Home;
